    fetch(`http://localhost:5000/api/maas360/${device_id}`)
      .then((response) => response.json())
      .then((data) => {
        setDevices(data.devices);
      })
      .catch((error) => console.error(error));
  }, []);

  return (
    <div>
      <h1>Device Data</h1>
      {devices.length > 0 ? (
        <ul>
          {devices.map((device) => (
            <li key={device.id}>
              <p>ID: {device.id}</p>
              <p>Name: {device.name}</p>
              <p>Model: {device.os}</p>
              <p>Status: {device.deviceStatus}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>No devices found</p>
      )}
    </div>
  );
}

export default MaaS360Data;
